import React from 'react';
import { Link } from 'react-router-dom';
import styles from './about.module.css'; // Asegúrate de cambiar la extensión a .module.css

import imagen from '../IMG/fondo_control.jpg';

function About() {
  return (
    <>
    
        return (
    <div className="imagenlanding">
      <img src={imagen} alt="foto" className="imagen-landing" />
      <div className="button-container">
      <Link to="/home">
        <button className={styles.button}>Volver al Inicio</button>
      </Link>
      </div>
    </div>
  );
    </>
  );
}

export default About;
